import React, { useState } from "react";
import { Link } from "react-router-dom";

const Profile = props => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-4">
          <div className="card">
            <img src="https://external-content.duckduckgo.com/iu/?u=http%3A%2F%2Fwww.baytekent.com%2Fwp-content%2Fuploads%2F2016%2F12%2Ffacebook-default-no-profile-pic1.jpg&f=1&nofb=1"/>
          </div>
        </div>
        <div className="col-lg-4">
          <h3 className=" text-middle align-middle">Name:TEST NAME</h3>
          <h4 className="align-middle">Last Login: Yesterday</h4>
        </div>
        <div className="col-lg-4">
        </div>
      </div>
      <div className="row">
        <p className="text-center">This is where the movies component goes.</p>
      </div>
    </div>
  );
};

export default Profile;
